			name = "Generate missions' protobuf files";
			outputFileListPaths = (
			);
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# The missions' input paths that contain the .proto files of the missions\nMISSIONS=(\n    \"${SRCROOT}/../common/missions/ophtalmo/protobuf/parrot/missions/ophtalmo/airsdk\"\n)\n# The output path that will contain the generated swift files.\nSWIFT_OUT=\"${SRCROOT}/OpenFlight/Resources/Protobuf\"\n\nmkdir -p \"$SWIFT_OUT\"\n\n# Retrieves a .proto file and copies it to the destination using the\n# packageName as its name.\nfunction retrieve_proto () {\n  # requires two arguments:\n    # - the source .proto file\n    # - the out path\n  local PROTO=\"$1\"\n  local OUT=\"$2\"\n  # get the package name and translate unsafe characters\n  local PACKAGE_NAME=$(grep -E '^package .*;' $PROTO | cut -d' ' -f2 | cut -d';' -f1 | tr '.-' '_')\n  # copy the .proto files in the SWIFT_OUT\n  cp -v \"$PROTO\" \"$OUT/$PACKAGE_NAME.proto\"\n}\n# export function so it can be used with find/xargs\nexport -f retrieve_proto\n\n# retrieve parrot extensions\nPARROT_EXTENSIONS=\"${SRCROOT}/../common/protobuf-extensions/protobuf/parrot/protobuf\"\nPARROT_EXTENSIONS_OUT=\"$SWIFT_OUT/parrot/protobuf\"\nmkdir -p \"$PARROT_EXTENSIONS_OUT\"\nfind \"$PARROT_EXTENSIONS\" -type f -name '*.proto' -print -exec cp -v \"{}\" \"$PARROT_EXTENSIONS_OUT\" \\;\n\n# for all missions retrieve the .proto files in SWIFT_OUT\nfor mission in \"${MISSIONS[@]}\"; do\n  find \"$mission\" -type f -name '*.proto' -print -exec sh -c 'retrieve_proto \"$1\" \"$2\"' _ {} \"$SWIFT_OUT\" \\;\ndone\n\n# then pass protobuf over the .proto files to generate the final swift\n# files (except for hello mission).\ncd \"$SWIFT_OUT\"\nfind . -type f -name 'parrot_*.proto' -exec protoc -I. --swift_out=\"$SWIFT_OUT\" \"{}\" \\;\n";
		};
